import React, { useState, useEffect } from "react";
import * as tagData from "../lib/api/getData";
import MainTrend from "../component/mainTrend";
import TrendContainer from "../component/mainTrendContainer";
import styled from "styled-components";

const TagTitle = styled.div`
  font-size: 30px;
`;

function Main() {
  const [trendData, setTrendData] = useState();

  const [day, setDay] = useState({
    gap: "day1_gap",
    rate: "day1_rate",
  });

  useEffect(async () => {
    //day1_gap
    const getTrendData = await tagData.mainData;

    setTrendData(getTrendData);

    console.log("trendData", trendData);
  }, []);
  return (
    <>
      <TagTitle>포스팅 증가량 순위</TagTitle>
      <TrendContainer type="gap" data={trendData} day={day.gap} />

      <TagTitle>포스팅 증가율 순위</TagTitle>
      <TrendContainer type="rate" data={trendData} day={day.gap} />

      <TagTitle>새롭게 분석 대상이 된 해시태그</TagTitle>
      <TrendContainer type="recent" data={trendData} />
    </>
  );
}

export default Main;
